from typing import Dict, List, Optional
from dataclasses import dataclass


@dataclass
class YandexRegion:
    """Регион Yandex"""

    id: int
    name: str
    parent_id: int
    country_code: str = ""


@dataclass
class GoogleLanguage:
    """Язык Google"""

    code: str
    name: str


@dataclass
class GoogleDomain:
    """Домен Google"""

    code: str
    name: str
    country: str = ""


@dataclass
class City:
    """Город"""

    id: int
    name: str
    canonical_name: str
    parent_id: int
    country_code: str
    target_type: str
    status: str


